function mapExample.totype(xg,yg)
    if  mapExample.example[cfg.mapExampleNumber][yg] and mapExample.example[cfg.mapExampleNumber][yg][xg]==0 then return TCell.newGround()
    elseif  mapExample.example[cfg.mapExampleNumber][yg] and mapExample.example[cfg.mapExampleNumber][yg][xg]==2 then return TCell.newGrass()
    elseif mapExample.example[cfg.mapExampleNumber][yg] and mapExample.example[cfg.mapExampleNumber][yg][xg]==3 then return TCell.newCave()
    elseif mapExample.example[cfg.mapExampleNumber][yg] and mapExample.example[cfg.mapExampleNumber][yg][xg]==4 then return TCell.newFood()
    else return nil 
    end
end

function mapExample.topass(xg,yg)
    if mapExample.example[cfg.mapExampleNumber][yg] and mapExample.example[cfg.mapExampleNumber][yg][xg]==1 then return false
    else return true
    end
end

